import React from 'react';
import check from "../assets/check.png";
import clock from "../assets/clock.png";
import support from "../assets/support.png";
import secure from "../assets/secure.png";

function ComparisonSection() {
  return (
    <section class="comparison-section">
    <div class="comparison-images">
      <div class="comparison-item">
        <img src="https://gray-kwqc-prod.cdn.arcpublishing.com/resizer/v2/2352AMPUOFMOFA4Z32BV4O327M.jpg?auth=6fac83890a9f96ad6a2de79d9d2930f4e5443638ba5f0d707615c88b1588b612&width=800&height=450&smart=true" />
        <div class="comparison-overlay">Reserve Your hotel, Pursue Your Team</div>
      </div>
      <div class="comparison-item">
        <img src="https://cf.bstatic.com/xdata/images/hotel/max1024x768/269149486.jpg?k=5c6aebf73204187f4c78c922e5b5c4001c397471b98aaa5562285c6fe44929cd&o=&hp=1" style="height: 350px;" alt="Image 2" />
        <div class="comparison-overlay">Subscribe Our Newsletter</div>
      </div>
      <div class="comparison-item">
        <img src="https://img.freepik.com/premium-photo/beautiful-luxury-hotel-swimming-pool_1029473-5500.jpg" style="height: 350px;" alt="Image 3" />
        <div class="comparison-overlay">Review Hotel Services Worldwide</div>
      </div>
      <div class="comparison-item">
        <img src="https://gambar.sgp1.digitaloceanspaces.com/wp-content/uploads/2022/02/27094103/Screen-Shot-2022-02-27-at-09.40.54.png" style="height: 350px;" alt="Image 4" />
        <div class="comparison-overlay">Follow the Lates Tour News</div>
      </div>
    </div>
  </section>
  );
}

export default ComparisonSection;
